import './App.css'
import { Link, Route } from 'wouter'
import Home from './pages/Home';
import SearchResults from './pages/SearchResults';
import Details from './pages/Details';
import { GifsContextProvider } from './Hooks/GifsContext';
import logo from './gifworld-logo.png'
export default function App() {

  return (
    <div className="App">
      <section className="App-content">
        <Link to='/'><img className='App-title' alt='Logo of GifWorld' src={logo} height='200px' width='200px'></img></Link>

        <GifsContextProvider>
          <Route component={Home} path='/home' />
          <Route component={SearchResults} path='/search/:keyword' />
          <Route component={Details} path='/gif/:id' /> 
        </GifsContextProvider>
      </section>
    </div>
  )
}
